import React from 'react'

const Home = () => {
    return (
        <>
           <div className="home-section">
               <h2 id="text"><span>It's Time to start</span><br />Study</h2>
               <a to="#" id="btn">Signin</a>
           </div>


        </>
    )
}

export default Home
